import React from 'react';
import {getPodcastsFromSpotify} from '../../services/Api'

const Test = () => {
    const getPodcast = () => {
        getPodcastsFromSpotify({ search: 'reply all' })
            .then((res) => {
                console.log(res)
            })
            .catch(e => console.log(e))
    }
    return (
        <div>
            <form>
                <input type="text" value='' placeholder='Busca' onChange={(e) => setSearch(e.target.value)}></input>
            </form>
            <button onClick={() => getPodcast()}>Clic</button>
        </div>
    );
};

export default Test;
